import React from "react";
import styles from "./LoadingIcon.module.css";

const LoadingIcon = () => {
  return (
    <div>
      <img
        src="../../assets/images/tardis.gif"
        alt="loading..."
        className={styles.gif}
      />
      <img
        src="./../assets/images/head1.png"
        alt="head"
        style={{ width: "50px", height: "50px" }}
      />
    </div>
  );
};

export default LoadingIcon;
